import React from 'react';
import logo from './logo.svg';
import './App.css';
import Header from './Pages/Header'
import Home from './Pages/Home'
import Energy from './Pages/Categories/Energy'

function App() {
  return (
    <div className="App">
      <Header />
      <Home />
      <Energy />
    </div>
  );
}

export default App;
